-- DB2024_TodayPS에 데이터 삽입
-- Bronze 추천 문제: DB2024_Problems에서 tier=1~5인 문제 중, 사람들에 의해 가장 많이 풀린 다섯 문제를 오늘의 추천 문제로 선택, DB2024_TodayPS에 pid (문제 번호) 삽입
select pid from DB2024_Problems
where tier between 1 and 5
order by solvednum desc limit 5;

-- Silver 추천 문제: DB2024_Problems에서 tier=6~10인 문제 중, 사람들에 의해 가장 많이 풀린 다섯 문제를 오늘의 추천 문제로 선택, DB2024_TodayPS에 pid (문제 번호) 삽입
select pid from DB2024_Problems
where tier between 6 and 10
order by solvednum desc limit 5;

-- Gold 추천 문제: DB2024_Problems에서 tier=11~15인 문제 중, 사람들에 의해 가장 많이 풀린 다섯 문제를 오늘의 추천 문제로 선택, DB2024_TodayPS에 pid (문제 번호) 삽입
select pid from DB2024_Problems
where tier between 11 and 15
order by solvednum desc limit 5;

